const this_table = 
	{
		arm:"12345",
		leg:"67890",
		head:"abcde"
	}
/**
	Prototype 2-dimensional lookup table, returns empty string if the given query does not exist in the table

	@param {String} query - the item to look up in the table
	@return {String} response - the code found in the table
*/
function lookupTest(query) {

	return this_table[query];
}

/**
	Prototype 2-dimensional lookup table with given default value

	@param {String} query - the item to look up in the table
	@param {String} defaultvalue - the value to return if the given query does not exist in the table
	@return {String} response - the code found in the table
*/
function lookupTest(query, defaultvalue) {

	return (this_table[query] || defaultvalue);
}

const sex_table = 
	{
		Male:"M",
		Female:"F",
		Unknown:"U",
		Other:"O"
	}
/**
	Prototype 2-dimensional lookup table, returns empty string if the given query does not exist in the table

	@param {String} sex - the item to look up in the table
	@return {String}  - the code found in the table
*/
function translateSex(sex) {

	return sex_table[sex];
}

/**
	Prototype 2-dimensional lookup table with given default value

	@param {String} sex - the item to look up in the table
	@param {String} defaultvalue - the value to return if the given query does not exist in the table
	@return {String}  - the code found in the table
*/
function translateSex(sex, defaultvalue) {

	return (sex_table[sex] || defaultvalue);
}

