properties.code:
/**
	This template accepts a date in yy-MMM-yyyy format with a 12-hour time + am/pm, modifies it into a
	valid format, and returns a valid Date object.

	@param {String} jankdate - the poorly-formatted date string
	@return {Date} a valid JavaScript Date object
*/
function fixjankassdate(jankdate) {
	//19-May-2021 2:44 pm to 5/19/2021
	//6/1/2021 1:51:00 AM
	//12/21/2020 4:09:44 PM
	logger.info('jankdate = ' + jankdate);

	const BAD_DATE = 0;
	const BAD_TIME = 1;
	const BAD_PERIOD = 2;
	const BAD_DAY = 0;
	const BAD_MONTH = 1;
	const BAD_YEAR = 2;
	const BAD_HOUR = 0;
	const BAD_MINUTES = 1;
	const BAD_SECONDS = 2;
	const months = {
		Jan: 0,
		Feb: 1,
		Mar: 2,
		Apr: 3,
		May: 4,
		Jun: 5,
		Jul: 6,
		Aug: 7,
		Sep: 8,
		Oct: 9,
		Nov: 10,
		Dec: 11
	};

	var spliced = jankdate.split(' ');
	if (spliced[BAD_DATE].indexOf("/") > -1) {
		//6/1/2021 1:51:00 AM
		var SPLIT_CHAR = "/";
		var splitdate = spliced[BAD_DATE].split(SPLIT_CHAR);
		var splittime = spliced[BAD_TIME].split(':');

		var day = splitdate[1];
		var month = splitdate[0]-1;
		var year = splitdate[BAD_YEAR];
	} else {
		//19-May-2021 2:44 pm
		var SPLIT_CHAR = "-";
		var splitdate = spliced[BAD_DATE].split(SPLIT_CHAR);
		var splittime = spliced[BAD_TIME].split(':');

		var day = splitdate[BAD_DAY];
		var month = months[splitdate[BAD_MONTH]];
		var year = splitdate[BAD_YEAR];
	}

	if (spliced[BAD_PERIOD].toLowerCase() == 'pm')
		var hour = parseInt(splittime[BAD_HOUR]) + 12;
	else
		var hour = splittime[BAD_HOUR];
	var minutes = splittime[BAD_MINUTES];

	//new Date(year, month, day, hours, minutes, seconds, milliseconds)
	var cleandate = new Date(year, month, day, hour, minutes, 0, 0);
	logger.info(year + ' ' + month + ' ' + day + ' ' + hour + ' ' + minutes);
	logger.info(cleandate.toString());
	return cleandate;

}

